// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.18;

library Roles {

    struct Role {
        mapping(address => bool) members;
        mapping(address => uint) levels;
    }

    function add(Role storage role, address account, uint inventory) internal {
        role.members[account] = true;
        role.levels[account] = inventory;
    }

    function verify(Role storage role, address account) internal view returns(bool) {
        return role.members[account];
    }

    function get(Role storage role, address account) internal view returns(uint) {
        return role.levels[account];
    }

    function busy(Role storage role, address account, uint volume) internal {
        role.levels[account] -= volume;
    }

    function free(Role storage role, address account, uint volume) internal {
        role.levels[account] += volume;
    }  
} 

abstract contract Warehouse {
    using Roles for Roles.Role;

    Roles.Role private warehouses;

    modifier onlyWarehouse {
        require( verifyWarehouse(msg.sender) );
        _;
    }

    function verifyWarehouse(address account) public view returns(bool) {
        return warehouses.verify(account);
    }

    function registerWarehouse(uint inventory) public {
        warehouses.add(msg.sender, inventory);
    }

    function storeWH(address account, uint volume) internal {
        warehouses.busy(account, volume);
    }

    function releaseWH(address account, uint volume) internal {
        warehouses.free(account, volume);
    }

    function getWH(address account) public view returns(uint) {
        return warehouses.get(account);
    }
} 

abstract contract Carrier {
    using Roles for Roles.Role;

    Roles.Role private carriers;

    modifier onlyCarrier {
        require( verifyCarrier(msg.sender) );
        _;
    }

    function verifyCarrier(address account) public view returns(bool) {
        return carriers.verify(account);
    }

    function registerCarrier(uint inventory) public {
        carriers.add(msg.sender, inventory);
    }

    function storeCarrier(address account, uint volume) internal {
        carriers.busy(account, volume);
    }

    function releaseCarrier(address account, uint volume) internal {
        carriers.free(account, volume);
    }

    function getCarrier(address account) public view returns(uint) {
        return carriers.get(account);
    }
} 

abstract contract IoT {

    // sensor => owner
    mapping(address => address) devices;

    modifier onlyIoT {
        require( verifyIoT(msg.sender) );
        _;
    }

    function verifyIoT(address account) public view returns(bool) {
        return devices[account] != address(0); 
    }

    function registerIoT(address account) public {
        devices[msg.sender] = account;
    }

    function getIoT(address account) public view returns(address) {
        return devices[account];
    }
} 

enum State { nostate, registered, forsale, ordered, intransit, delivered }

abstract contract AbstractAsset {

    mapping(string => Asset) assets;

    struct Asset {
        uint volume;
        string temperature;
        string position;
        uint price;
        State state;
        address owner;
        address keeper;
    }

    event ReportState(string indexed id, State state);
    event TransferOwner(string indexed id, address from, address to);
    event TransferKeeper(string indexed id, address from, address to);
    event Track(string indexed id, State state, string temperature, string position, address sensor, address actorID, uint timestamp);

    modifier onlyOwner(string memory id) {
        require(assets[id].owner == msg.sender);
        _;
    }

    modifier onlyKeeper(string memory id) {
        require(assets[id].keeper == msg.sender);
        _;
    }

    modifier isEnough(uint price) {
        require(msg.value / 1 ether >= price);
        _;
    }  
}

contract ConcreteAsset is AbstractAsset, Warehouse, Carrier, IoT {

    function create(string memory id, uint volume) external { // onlyWarehouse {
        // require(assets[id].state == State.nostate);

        require(getWH(msg.sender) > volume);

        storeWH(msg.sender, volume);

        emit ReportState(id, State.registered);
        assets[id].state = State.registered;

        emit TransferOwner(id, assets[id].owner, msg.sender);
        assets[id].owner = msg.sender;

        emit TransferKeeper(id, assets[id].keeper, msg.sender);
        assets[id].keeper = msg.sender;

        assets[id].volume = volume;
    }

    function forsale(string memory id, uint price) external { // onlyOwner(id) onlyKeeper(id) onlyWarehouse {
        // require(assets[id].state == State.registered || assets[id].state == State.delivered);

        emit ReportState(id, State.forsale);
        assets[id].state = State.forsale;

        assets[id].price = price;
    }

    function order(string memory id) external payable  { // isEnough(assets[id].price) onlyWarehouse {
        // require(assets[id].state == State.forsale); 

        require(getWH(msg.sender) > assets[id].volume);

        storeWH(msg.sender, assets[id].volume);

        (bool success,) = assets[id].owner.call{value: msg.value}("");
        require(success);

        emit ReportState(id, State.ordered);
        assets[id].state = State.ordered;

        emit TransferOwner(id, assets[id].owner, msg.sender);
        assets[id].owner = msg.sender;
    }

    function take(string memory id) external { // onlyCarrier {
        // require(assets[id].state == State.ordered);

        require(getCarrier(msg.sender) > assets[id].volume);

        storeCarrier(msg.sender, assets[id].volume);

        releaseWH(assets[id].keeper, assets[id].volume);

        emit ReportState(id, State.intransit);
        assets[id].state = State.intransit;

        emit TransferKeeper(id, assets[id].keeper, msg.sender);
        assets[id].keeper = msg.sender;
    }

    function delivered(string memory id) external { // onlyKeeper(id) onlyCarrier {
        // require(assets[id].state == State.intransit);

        releaseCarrier(msg.sender, assets[id].volume);

        emit ReportState(id, State.delivered);
        assets[id].state = State.delivered;

        emit TransferKeeper(id, assets[id].keeper, assets[id].owner);
        assets[id].keeper = assets[id].owner;
    }

    function track(string memory id, string memory temp, string memory position) external {//onlyIoT {
        emit Track(id, assets[id].state, temp, position, msg.sender, getIoT(msg.sender), block.timestamp);
        assets[id].temperature = temp;
        assets[id].position = position;
    }

    function getAsset(string memory id) external view returns(Asset memory) {
        return assets[id];
    }
}

contract SupplyChain is ConcreteAsset {

    constructor() {
        registerWarehouse(10000);
        registerCarrier(10000);
        registerIoT(msg.sender);
    }

}
